import { useEffect, useState } from "react";
import { useNavigate } from "react-router-dom";
import {
  Table,
  TableBody,
  TableCell,
  TableContainer,
  TableHead,
  TableRow,
  Paper,
  Typography,
  Grid,
  Card,
  CardContent,
} from "@mui/material";

export default function AccountsList({ searchValue = "" }) {
  const [accounts, setAccounts] = useState([]);
  const [filteredAccounts, setFilteredAccounts] = useState([]);
  const navigate = useNavigate();

  // Load all accounts once
  useEffect(() => {
    fetch("http://localhost:8000/accounts")
      .then((res) => {
        if (!res.ok) throw new Error("Failed to fetch");
        return res.json();
      })
      .then((data) => {
        setAccounts(data || []);
        setFilteredAccounts(data || []);
      })
      .catch((err) => {
        console.error("Accounts fetch error:", err);
        setAccounts([]);
        setFilteredAccounts([]);
      });
  }, []);

  // Filter whenever searchValue OR accounts change
  useEffect(() => {
    if (!accounts.length) {
      setFilteredAccounts([]);
      return;
    }

    const term = (searchValue || "").trim().toLowerCase();

    if (!term) {
      setFilteredAccounts([...accounts]);
      return;
    }

    const filtered = accounts.filter((acc) =>
      String(acc.name || "").toLowerCase().includes(term)
    );

    setFilteredAccounts(filtered);

    // Optional: help debugging
    console.log(`Search term: "${term}" → found ${filtered.length} accounts`);
  }, [searchValue, accounts]);

  // Totals are always from ALL accounts (not filtered)
  const totalAccounts = accounts.length;
  const totalQuoted = accounts.reduce(
    (sum, acc) => sum + Number(acc.quoted_cost || 0),
    0
  );

  return (
    <>
      <Typography variant="h4" gutterBottom>
        AWS Cost Dashboard - Accounts Overview
      </Typography>

      <Grid container spacing={3} sx={{ mb: 4 }}>
        <Grid item xs={12} sm={6}>
          <Card sx={{ bgcolor: "#e3f2fd" }}>
            <CardContent sx={{ textAlign: "center" }}>
              <Typography variant="subtitle2" color="text.secondary">
                Total Accounts
              </Typography>
              <Typography variant="h4" fontWeight="bold" color="primary.main">
                {totalAccounts}
              </Typography>
            </CardContent>
          </Card>
        </Grid>

        <Grid item xs={12} sm={6}>
          <Card sx={{ bgcolor: "#e8f5e9" }}>
            <CardContent sx={{ textAlign: "center" }}>
              <Typography variant="subtitle2" color="text.secondary">
                Total Quoted Cost
              </Typography>
              <Typography variant="h4" fontWeight="bold" color="success.dark">
                ${totalQuoted.toFixed(2)}
              </Typography>
            </CardContent>
          </Card>
        </Grid>
      </Grid>

      <Typography variant="h5" gutterBottom>
        All Accounts
        {searchValue.trim() && (
          <Typography component="span" color="text.secondary" sx={{ ml: 2 }}>
            (showing {filteredAccounts.length} matches)
          </Typography>
        )}
      </Typography>

      <TableContainer component={Paper}>
        <Table>
          <TableHead>
            <TableRow sx={{ bgcolor: "#f5f5f5" }}>
              <TableCell><strong>Account Name</strong></TableCell>
              <TableCell><strong>Quoted Cost</strong></TableCell>
              <TableCell><strong>Onboard Date</strong></TableCell>
            </TableRow>
          </TableHead>
          <TableBody>
            {filteredAccounts.length === 0 ? (
              <TableRow>
                <TableCell colSpan={3} align="center" sx={{ py: 4 }}>
                  <Typography color="text.secondary">
                    {searchValue.trim()
                      ? `No accounts found matching "${searchValue.trim()}"`
                      : "No accounts available"}
                  </Typography>
                </TableCell>
              </TableRow>
            ) : (
              filteredAccounts.map((acc) => (
                <TableRow
                  key={acc.account_id}
                  hover
                  sx={{ cursor: "pointer" }}
                  onClick={() => navigate(`/accounts/${acc.account_id}`)}
                >
                  <TableCell>{acc.name}</TableCell>
                  <TableCell>${Number(acc.quoted_cost || 0).toFixed(2)}</TableCell>
                  <TableCell>{acc.onboard_date}</TableCell>
                </TableRow>
              ))
            )}
          </TableBody>
        </Table>
      </TableContainer>
    </>
  );
}
